My Face Shaving Routine!🪒🧼

My skin is extremely dry and sensitive, i have to make sure that my skin is hydrated well post shaving. Always use a aloe vera gel or thick moisturiser before shaving so, that the razor glides on smoothly! I do this twice a month, to remove peach fuzz, and my face feels really soft, makeup glides on beautifully!✨

And, NO your hair does not grow thicker🤭

